webpackJsonp([0xdf773f895ecd],{363:function(a,t){a.exports={data:{site:{siteMetadata:{title:"RORSCHARG",author:"Rorscharg"}},markdownRemark:{id:"/home/calm/Programming/Repos/rorscharg.github.io/src/pages/blog/fast/index.md absPath of file >>> MarkdownRemark",html:"<p>I really wish things would go faster,<br>\nI want to be motivated,<br>\nto have a purpose,<br>\nto end life in exhaustion because I’ve lived too much.</p>\n<p>School is slow, it slowly burns me out,<br>\nturns me into a ghoul,<br>\nslowly drags through the mud.</p>\n<p>I’ve given up on being rich,<br>\nI feel like I really don’t care much about money anymore<br>\nWhat I really want is to be fired up by something<br>\nI want mind to be absorbed into something,<br>\nlose track of time,<br>\ngo on endlessly.</p>\n<p>I want to fall for a long time,<br>\nFeel the wind striking my face,<br>\nFeel the adrenaline of free falling.<br>\nNot look back,<br>\nEnjoy the moment<br>\nforever</p>",frontmatter:{title:"Fast",date:"May 05, 2018",image:{childImageSharp:{responsiveSizes:{src:"/static/fast-1a43ab970da3024579d26d7133420a6b-55fc6.jpg",srcSet:"/static/fast-1a43ab970da3024579d26d7133420a6b-41b2b.jpg 500w,\n/static/fast-1a43ab970da3024579d26d7133420a6b-fd1e7.jpg 1000w,\n/static/fast-1a43ab970da3024579d26d7133420a6b-55fc6.jpg 2000w,\n/static/fast-1a43ab970da3024579d26d7133420a6b-269e5.jpg 3000w,\n/static/fast-1a43ab970da3024579d26d7133420a6b-583ee.jpg 4000w,\n/static/fast-1a43ab970da3024579d26d7133420a6b-43fd4.jpg 4200w",sizes:"(max-width: 2000px) 100vw, 2000px"}}}}}},pathContext:{slug:"/blog/fast/",previous:null,next:null}}}});
